import React from 'react';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Page from './utilities/Page';
import UTextInput from './utilities/UTextInput';
import USelectDropdown from './utilities/USelectDropdown';
import UButton from './utilities/UButton';
import UTextArea from './utilities/UTextArea';
import Modal from 'react-bootstrap/Modal';
import './../style/CreateJobStyle.css';

export default () => {
    // const [show, setShow] = useState(false);
    let show = false;

    function handleClose() {
        show = false;
    }
    function handleShow() {
        show = true;
    }

    return (
        <Page>
            <Row>
                <Col>
                    <Row>
                        <UTextInput placeholder='Model Name'></UTextInput>
                    </Row>
                    <Row>
                        <div className='mb-3'>
                            <UButton onClick={() => {}} variant={'secondary'} size={'sm'}>
                                Select File
                            </UButton>
                        </div>
                    </Row>
                    <Row>
                        <USelectDropdown placeholder='Filament' options={['one', 'two', 'three']}></USelectDropdown>
                    </Row>
                    <Row>
                        <USelectDropdown placeholder='Fill' options={['one', 'two', 'three']}></USelectDropdown>
                    </Row>
                    <Row>
                        <UTextInput placeholder='Dimensions'></UTextInput>
                        <Modal show={show} onHide={handleClose}>
                            <Modal.Header closeButton>
                                <Modal.Title>Modal heading</Modal.Title>
                            </Modal.Header>
                            <Modal.Body>Woohoo, you're reading this text in a modal!</Modal.Body>
                            <Modal.Footer>
                                <UButton>Close</UButton>
                                <UButton>Save Changes</UButton>
                            </Modal.Footer>
                        </Modal>
                    </Row>
                    <Row className='shipping-details-area pt-3 px-3'>
                        <div className='mb-1 ml-1'>
                            <span>Shipping Details</span>
                        </div>
                        <UTextInput placeholder='Street Address'></UTextInput>
                        <Col className='pl-0'>
                            <UTextInput placeholder='City'></UTextInput>
                        </Col>
                        <Col>
                            <UTextInput placeholder='State'></UTextInput>
                        </Col>
                        <Col className='pr-0'>
                            <UTextInput placeholder='Zip'></UTextInput>
                        </Col>
                    </Row>
                    <Row className='mt-3'>
                        <UTextArea placeholder='Details'></UTextArea>
                    </Row>
                    <Row>
                        <UButton size='lg'>Create Model</UButton>
                    </Row>
                </Col>
                <Col></Col>
            </Row>
        </Page>
    );
};
